const TabelPengunjung = (props) => {
    const {data} = props;


    return (
        <div>
            <thead>
                <td>Nama</td>
                <td>Umur</td>
                <td>Jenis Kelamin</td>
                <td>Aksi</td>
            </thead>

            <tbody>
                    {data.map((passanger) => 
                <tr>    
                        <td key={passanger.id}>{passanger.nama}</td>
                        <td>{passanger.umur}</td>
                        <td>{passanger.jenisKelamin}</td>
                        <td>
                            <button>Hapus</button>
                        </td>
                </tr>
                    )}
            </tbody>
        </div>
    )
}

export default TabelPengunjung;
